import React, { Component } from 'react';
import Hello from './Hello';

export default class Welcome extends Component {
    render() {
      return (
        <div className="App tile ancestor">
          <h1 className="title">Have a break !</h1>
          <Hello />
        </div>
      );
    }
  }
